АНАЛОГ ВЗАМЕН: Commax CDV-50A/M-VizitОписание Commax CDV-50A Coordinate NTSCДанная модель видеодомофона имеет цветной TFT LCD дисплей, диагональ которого составляет 5 дюймов. Технические возможности Commax CDV-50A Coordinate NTSC позволяют использовать одновременно до 4 вызывных панелей (NTCS). Также вместо вызывных панелей можно подключить столько же цветных видеокамер (NTCS). Главной отличительной чертой этого видеодомофона является возможность подсоединения к координатному (аналоговому) подъездному домофону, при этом не нужно покупать какие-либо дополнительные устройства. Кроме того, в домофон встроена энергонезависимая карта памяти, которая позволяет хранить до 230 кадров. Данное устройство призвано делать фотоснимки людей, которые нажимают на вызывную панель. На такой фотографии отражаются дата и время визита. Производители  позаботились также и возможности вести видеосъёмку (для этого нужно дополнительно купить и подключить видеокамеру). А для того, чтобы не снимать пустое место, в видеодомофон встроен детектор движения, который автоматически включает запись изображения с видеокамеры, если что-то «почувствует». Видеодомофон очень удобны благодаря тому, что они устроены по принципу Hands free, то есть в них отсутствует привычная трубка, которая попросту не нужна.  При установке данного видеодомофона применяется накладной тип крепления, а сам аппарат крепится на кронштейн.Технические характеристики Commax CDV-50A Coordinate NTSCТип: видеодомофон цветной;
Экран: 5" NTSC TFT;
Изящный дизайн, высококачественный пластик, вариант исполнения "Hands Free" (без трубки);
Возможность подключения дополнительной аудиотрубки DP-4VR;
Встроенный блок энерго-независимой памяти с объемом записи до 1000 кадров;
Питание:	100-240 В  50/60 Гц;
