АНАЛОГ ВЗАМЕН: Commax CDV-50A/DRC-40CKОписание Commax CDV-50P/DRC-4CP сереброCommax CDV-50P/DRC-4CP медь - комплект, состоящий из видеомонитора серии CDV-50P и вызывного устройства серии DRC-40CK.В видеодомофон Commax CDV-50P установлен высококачественный TFT LCD цветной дисплей, размером 12.7 см (5"), обеспечивающий высокое разрешение и идеальное изображение. К нему возможно подключение двух вызывных панелей или двух  камер, либо одной панели и одной камеры. При поступлении звонка на видеодомофон экран будет работать в течение 30 секунд, а в случае поднятии трубки время разговора ограниченно 60 секундами. Есть возможность подключения одного интерфона (аудиотрубки DP-4VR), и, что не маловажно, к видеодомофону можно параллельно подключить второй видеомонитор (подключив каждую вызывную панель к двум домофонам).Данная модель не имеет системы громкой связи, т.е. разговор можно вести исключительно по трубке. Предельное расстояние действия вызывной панели или камеры при сечении провода 0,65 составляет 50 метров, а при сечении 0,5 соответственно 25 метров, а так как на модели есть возможность управления замком, т.е. вы можете открывать дверь посетителю не отходя от домофона, Вам не придется бегать каждый раз и открывать дверь вручную.Цветная вызывная панель Commax DRC-4CP накладная предназначена для работы в составе видеодомофона. Совместима с видеомониторами Commax, схема подключения 4-хпроводная, имеет встроенную светодиодную подсветку. Для удобства использования может быть установлена под углом к двери, уголок в комплекте. Выполнена в антивандальном металлическом корпусе. Питание +12В от монитора. Работает с цветными видеодомофонами Commax стандарта NTSC.Технические характеристики Commax CDV-50P/DRC-4CP сереброЭкран: 5 дюймов (~12,7 см) цветной TFT LCD (LED-подсветка);
Подключение до 2-х вызывных панелей или 2-х видеокамер;
Рабочая температура: 0....+40 °С, -10 до +50° С;
Питание: 100~220V , 50/60Hz;
Размеры: 259X158X53мм, 118x50x25мм;
